import PropTypes from "prop-types";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Tabs from "@material-ui/core/Tabs";
import Tab from "@material-ui/core/Tab";
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <Typography
      component="div"
      role="tabpanel"
      hidden={value !== index}
      id={`scrollable-auto-tabpanel-${index}`}
      aria-labelledby={`scrollable-auto-tab-${index}`}
      {...other}
    >
      <Box p={3}>{children}</Box>
    </Typography>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired
};

function a11yProps(index) {
  return {
    id: `scrollable-auto-tab-${index}`,
    "aria-controls": `scrollable-auto-tabpanel-${index}`
  };
}

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
    width: "100%",
    backgroundColor: theme.palette.background.paper
  }
}));

export default function ScrollableTabsButtonAuto() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const sushis = [
    { id: 1, item: "Tuna" },
    { id: 2, item: "Salmon" },
    { id: 3, item: "Escolar (Ono)" },
    { id: 4, item: "Albacore" },
    { id: 5, item: "Halibut" },
    { id: 6, item: "Yellowtail" },
    { id: 7, item: "Shrimp" },
    { id: 8, item: "White Fish" },
    { id: 9, item: "Crab" },
    { id: 10, item: "Red Clam" },
    { id: 11, item: "Octopus" },
    { id: 12, item: "Egg" },
    { id: 13, item: "Smelt Egg" },
    { id: 14, item: "Squid" },
    { id: 15, item: "Fresh Water Eel" },
    { id: 16, item: "Salmon Egg" },
    { id: 17, item: "Ocean Striped Bass" },
    { id: 18, item: "Scallop" },
    { id: 19, item: "Mackerel" }
  ];
  const listSushis = sushis.map(sushi => <li key={sushi.id}>{sushi.item}</li>);

  const regularRolls = [
    { id: 1, item: "Tuna Roll" },
    { id: 2, item: "Crab Roll" },
    { id: 3, item: "Eel Roll" },
    { id: 4, item: "Scallop Roll" },
    { id: 5, item: "Avocado Roll" },
    { id: 6, item: "Shrimp Roll" },
    { id: 7, item: "Cucumber Roll" },
    { id: 8, item: "Yellowtail Roll" },
    { id: 9, item: "California Roll" },
    { id: 10, item: "Salmon Roll" },
    { id: 11, item: "Vegetable Roll" },
    { id: 12, item: "Spicy Tuna Roll" },
    { id: 13, item: "Salmon Skin Roll" },
    { id: 14, item: "Shrimp Crab Roll" },
    { id: 15, item: "Asparagus Roll" },
    { id: 16, item: "Albacore Roll" },
    { id: 17, item: "Philly Roll" }
  ];

  const listRegularRolls = regularRolls.map(regularRoll => (
    <li key={regularRoll.id}>{regularRoll.item}</li>
  ));

  const freshRolls = [
    { id: 1, item: "Sakura Roll" },
    { id: 2, item: "Lemon Roll" },
    { id: 3, item: "Spicy Albacore Crunch Roll" },
    { id: 4, item: "Rainbow Roll" },
    { id: 5, item: "Alaskan Roll" },
    { id: 6, item: "Albacore Delight Roll" },
    { id: 7, item: "Mexican Roll" },
    { id: 8, item: "Hawaiian Roll" },
    { id: 9, item: "911 Roll" }
  ];
  const listFreshRolls = freshRolls.map(freshRoll => (
    <li key={freshRoll.id}>{freshRoll.item}</li>
  ));

  const tempuraRolls = [
    { id: 1, item: "Crunch Roll" },
    { id: 2, item: "Popcorn Lobster Roll" },
    { id: 3, item: "Crunch Scallop Roll" },
    { id: 4, item: "Heart Attack" },
    { id: 5, item: "California Tempura Roll" },
    { id: 6, item: "Tempura Roll" },
    { id: 7, item: "Tiger Roll" },
    { id: 8, item: "Vegas Roll" },
    { id: 9, item: "Spicy Tuna Tempura Roll" },
    { id: 10, item: "Spider Roll" }
  ];

  const listTempuraRolls = tempuraRolls.map(tempuraRoll => (
    <li key={tempuraRolls.id}>{tempuraRoll.item}</li>
  ));

  const bakedRolls = [
    { id: 1, item: "Baked Salmon Roll" },
    { id: 2, item: "Sunset Roll" },
    { id: 3, item: "Volcano Roll" },
    { id: 4, item: "Caterpillar Roll" },
    { id: 5, item: "Lobster Roll" },
    { id: 6, item: "BSC Roll" }
  ];

  return (
    <div className={classes.root}>
      <AppBar position="static" color="default">
        <Tabs
          value={value}
          onChange={handleChange}
          indicatorColor="primary"
          textColor="primary"
          variant="scrollable"
          scrollButtons="auto"
          aria-label="scrollable auto tabs example"
        >
          <Tab label="Sushi" {...a11yProps(0)} />
          <Tab label="Regular Rolls" {...a11yProps(1)} />
          <Tab label="Fresh Rolls" {...a11yProps(2)} />
          <Tab label="Tempura Rolls" {...a11yProps(3)} />
          <Tab label="Baked Rolls" {...a11yProps(4)} />
          <Tab label="Specialty Item" {...a11yProps(5)} />
          <Tab label="Appetizers" {...a11yProps(6)} />
          <Tab label="Kitchen" {...a11yProps(7)} />
        </Tabs>
      </AppBar>
      <TabPanel value={value} index={0}>
        <ul>{listSushis}</ul>
      </TabPanel>
      <TabPanel value={value} index={1}>
        <ul>{listRegularRolls}</ul>
      </TabPanel>
      <TabPanel value={value} index={2}>
        <ul>{listFreshRolls}</ul>
      </TabPanel>
      <TabPanel value={value} index={3}>
        <ul>{listTempuraRolls}</ul>
      </TabPanel>
      <TabPanel value={value} index={4}>
        Item Five
      </TabPanel>
      <TabPanel value={value} index={5}>
        Item Six
      </TabPanel>
      <TabPanel value={value} index={6}>
        Item Seven
      </TabPanel>
    </div>
  );
}
